import React from 'react';
// import Heart from '../../../assets/white.png';
import Link from 'next/link';
import Image from '../../UI/Image/Image';
import Button from '../../UI/Button/Button';

const post = (props)=>(
        <div className="row">
                <h6>{props.name}</h6>
               
                    
                        
                   
                        <div className="con">
                        <Image image={props.image}/>     
                        <div className="overlay">
                        <Link href={{ pathname: 'http://localhost:8080/add', query: { name: 'Zeit' } }}>
                            <a><Button>fa fa-fw fa-heart</Button></a>
                        </Link>
                        </div>
                      </div> 

                <style jsx>
                {`
                    h6{
                        color: blue;
                    }
                    img {
                        max-width: 100%;
                        height: auto;
                    }
                    a{
                        position: absolute;
                        bottom: 8px;
                        left: 16px;
                        
                    }
                
                `}    
                </style>
                <hr/>
        </div>
);



export default post;
